                                </div>



                                <button
  className="btn btn-success"
  onClick={(e) => validateForm() && saveOrUpdateEmployee(e)}
>
  Submit
</button>


                                {/* <button className = "btn btn-success" onClick = {(e) => saveOrUpdateEmployee(e) && onClick={validateForm}} >Submit </button> */}
                                <Link to="/employees" className="btn btn-danger"> Cancel </Link>
                            </form>

                        </div>
                    </div>
                </div>

           </div>

        </div>
    )
}

export default AddEmployeeComponent
